import * as React from "react";
import { DataGrid } from "@mui/x-data-grid";
import { Container } from "@mui/material";
import { useState, useEffect } from "react";
const columns = [
  { field: "action", headerName: "Action", width: 110 },
  { field: "title", headerName: "Title", width: 110 },
  { field: "category", headerName: "Category", width: 130 },
  {
    field: "price",
    headerName: "Price",
    type: "number",
    width: 110,
  },
  {
    field: "offer-price",
    headerName: "Offer-Price",
    type: "number",
    width: 130,
  },
  { field: "photo", headerName: "Photo", width: 130 },
  { field: "created-by", headerName: "Created-By", width: 130 },
  { field: "status", headerName: "Status", width: 110 },
  { field: "created-at", headerName: "Created-At", width: 130 },
];
export default function DataTable() {
  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = () => {
    return fetch("https://groceryshop-api.herokuapp.com/api/product").then((req) => {
      req.json().then((result) => {
        console.log(result);
      });
    });
  };
  return (
    <div>
      <Container style={{ height: 800, width: "100%" }}>
        <DataGrid columns={columns} pageSize={5} rowsPerPageOptions={[5]} checkboxSelection />
      </Container>
    </div>
  );
}
